me\" -nt \"../$sdir/$lname\" ]; then\n\t\t\t\techo \"$prefix $2/$lname already uptodate\"\n\t\t\telse\n\t\t\t\techo \"$prefix Copying ../$sdir/$lname to $2\"\n\n\t\t\t\t# Dylib kopieren\n\t\t\t\tcp -a \"../$sdir/$lname\" \"$2\"\n\t\t\t\tif [ -d \"../$sdir/$lname.dSYM\" ]; then \n\t\t\t\t\tcp -a \"../$sdir/$lname.dSYM\" \"$2\"\n\t\t\t\tfi\t\n\t\t\t\tmakeRelocatable \"$2/$lname\" \"$2\" \"$prefix*\"\n\t\t\tfi\n\t\tfi\n\tdone\n\n\techo \"$prefix Finished $1\"\n}\n\nmakeRelocatable \"$BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app/Contents/MacOS/$PRODUCT_NAME\" \"$DESTDIR/lib\" \"*\"\n\n# Plugins relokierbar machen\nfind \"$DESTDIR/lib\" -name \"*.so\" | \\\nwhile read l; do\n\tmakeRelocatable \"$l\" \"$DESTDIR/lib\" \"*\"\ndone";
